import React from 'react';
import './App.css';
import Heading from "./components/Heading"

function App() {
  return (
    <div className="container">
      <Heading />
      <h1>Page Title</h1>
      <p>In hac habitasse platea dictumst. Donec convallis finibus elit, tincidunt elementum elit sollicitudin quis.</p>
      <ul>
        <li>Lorem</li>
        <li>Ipsum</li>
        <li>Dolor</li>
        <li>More lorem</li>
        <li>Some other ipsum</li>
      </ul>
    </div>

  );
}


export default App;
